import React from 'react';
//Styles
import './Team.css';
//Component
import Header from '../Header/Header';
//Data
import { STAFF } from '../../shared/staff';


const renderStaffs = staffs => staffs.map(staff => 
    <div className="staff__card">
        <img src={staff.image} />
        <h2>{staff.title} Meet {staff.name}</h2>
        <h4>{staff.description}</h4>
    </div>
    );




const Team = () => {
    const staffs = STAFF;
    const staffCards = renderStaffs(staffs);

    return (
        <div>
            <Header color={'var(--DarkNavy)'} barColor={'var(--Blue)'} />
            <div className="staff_grid">
                {staffCards}
            </div>
        </div>
    );
}

export default Team;
